import React, { Component } from "react";

class Header extends Component {
  state = {};
  render() {
    return (
      <div className="container">
        <header className="page-header">
          <blockquote>Stel hier u lunchpakket samen.</blockquote>
        </header>
      </div>
    );
  }
}

export default Header;
